import React from "react";
import DeleteOutlineIcon from '@material-ui/icons/DeleteOutline';



function Note(props){

    function handleChange(){
        props.onDelete()
        
    }

    return <div className="note">
            <h1>{props.title}</h1>
            <p>{props.content}</p>
            <button onClick={handleChange}>
                <DeleteOutlineIcon />
            </button>

            </div>
}

export default Note;
